import React, {Component} from 'react';
import {Box, Divider, Flex, Heading, HStack, Text, VStack} from "@chakra-ui/react";
import {MdAccountCircle} from "react-icons/all";

const SettingPage = () => {
    return (
        <Flex w={'100%'} bg={'gray.100'} justifyContent={'center'}>
            <Box p={8} bg={'white'} minH={'1000px'} w={'630px'}>
                <VStack spacing={10} align={'start'}>
                    <Heading fontSize={20}>Setting</Heading>
                    <VStack>
                        <HStack>
                            <MdAccountCircle size={20}/>
                            <Text fontWeight={'medium'} fontSize={18}>Account</Text>
                        </HStack>
                        <Divider colorScheme={'teal'}/>
                    </VStack>

                </VStack>
            </Box>
        </Flex>
    );
};

export default SettingPage;
